"use strict";var initAjaxDropDownList=function(n){var i=$("#"+n).data("url"),r=$("#"+n).data("value"),u=$("#"+n).data("option-value"),t=$("#"+n).data("option-text");$.ajax({cache:!1,url:i,dataType:"json",success:function(i){var f=[],e="<option value='",o="<\/option>";typeof t!=typeof undefined&&t!==!1&&f.push(e+u+"'> "+t+o);$.each(i,function(n,t){t.Value==r?f.push(e+t.Value+"' selected='selected'> "+t.Text+o):f.push(e+t.Value+"'>"+t.Text+o)});$("#"+n).html(f.join(""))}})};